import React from "react";
import "./SaveList.css";
import Button from "@material-ui/core/Button";
import Icon from "@material-ui/core/Icon";
import DeleteIcon from "@material-ui/icons/Save";
import SaveIcon from "@material-ui/icons/Save";

const SaveList = ({
  saverValue,
  setsaverValue,
  saveUpShit,
  checkAll,
  uncheckAll,
  clearAll,
}) => {
  return (
    <div className="saveList">
      <div>
        <input
          maxLength="20"
          type="text"
          value={saverValue}
          onChange={(e) => setsaverValue(e.target.value)}
        />
        <Button
          variant="contained"
          onClick={saveUpShit}
          startIcon={<SaveIcon />}
        >
          Save
        </Button>
      </div>
      <div>
        <Button variant="contained" onClick={checkAll}>
          Check all
        </Button>
        <Button variant="contained" onClick={uncheckAll}>
          Uncheck all
        </Button>
        <Button
          variant="contained"
          color="secondary"
          startIcon={<DeleteIcon />}
          onClick={clearAll}
        >
          Clear List
        </Button>
      </div>
    </div>
  );
};

export default SaveList;
